import React from 'react'
import BtnLink from "../../Layouts/BtnLink/BtnLink"

const Nav = () => {
  const linkList = [
    { title: 'Каталог провайдеров', href: '/' },
    { title: 'Рейтинг провайдеров', href: '/' },
    { title: 'Акции', href: '/' },
    { title: 'Тарифы', href: '/' },
    { title: 'Сравнить тарифы', href: '/' },
  ]
  return (
    <div>
      { linkList.map(({ title, href, isNativeLink }, key) => {
        <BtnLink title={ title }
                 href={ href }
                 isNativeLink={ isNativeLink }
                 key={ key }/>
      }) }
    </div>
  )
}

export default Nav
